const e=JSON.parse('{"key":"v-e90d77c4","path":"/30.%E7%BC%96%E7%A8%8B%E6%8A%80%E5%B7%A7/15.VUE%E5%BA%94%E7%94%A8/60.Vite%E4%BB%8B%E7%BB%8D.html","title":"Vite介绍","lang":"zh-CN","frontmatter":{"title":"Vite介绍","date":"2023-05-16T00:00:00.000Z","category":["编程技巧","VUE应用"],"tag":["VUE应用"],"description":"1.1、什么是Vite Vite是一种新型的前端构建工具，它能显著改善前端开发体验。 Vite由两个主要部分组成： dev server：利用浏览器的ESM能力来提供源文件，具有丰富的内置功能并具有高效的HMR 生产构建：生产环境利用Rollup来构建代码，提供指令用来优化构建过程 Vite作为一个基于浏览器原生ESM的构建工具，它省略了开发环境的打包过程，利用浏览器去解析imports，在服务端按需编译返回。同时，在开发环境拥有速度快到惊人的模块热更新，且热更新的速度不会随着模块增多而变慢。因此，使用Vite进行开发，至少会比Webpack快10倍左右。","head":[["meta",{"property":"og:url","content":"https://haijunit.top/blog/30.%E7%BC%96%E7%A8%8B%E6%8A%80%E5%B7%A7/15.VUE%E5%BA%94%E7%94%A8/60.Vite%E4%BB%8B%E7%BB%8D.html"}],["meta",{"property":"og:site_name","content":"学习笔记"}],["meta",{"property":"og:title","content":"Vite介绍"}],["meta",{"property":"og:description","content":"1.1、什么是Vite Vite是一种新型的前端构建工具，它能显著改善前端开发体验。 Vite由两个主要部分组成： dev server：利用浏览器的ESM能力来提供源文件，具有丰富的内置功能并具有高效的HMR 生产构建：生产环境利用Rollup来构建代码，提供指令用来优化构建过程 Vite作为一个基于浏览器原生ESM的构建工具，它省略了开发环境的打包过程，利用浏览器去解析imports，在服务端按需编译返回。同时，在开发环境拥有速度快到惊人的模块热更新，且热更新的速度不会随着模块增多而变慢。因此，使用Vite进行开发，至少会比Webpack快10倍左右。"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"og:updated_time","content":"2023-05-23T07:13:54.000Z"}],["meta",{"property":"article:author","content":"知识库"}],["meta",{"property":"article:tag","content":"VUE应用"}],["meta",{"property":"article:published_time","content":"2023-05-16T00:00:00.000Z"}],["meta",{"property":"article:modified_time","content":"2023-05-23T07:13:54.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"Vite介绍\\",\\"image\\":[\\"\\"],\\"datePublished\\":\\"2023-05-16T00:00:00.000Z\\",\\"dateModified\\":\\"2023-05-23T07:13:54.000Z\\",\\"author\\":[{\\"@type\\":\\"Person\\",\\"name\\":\\"知识库\\",\\"url\\":\\"https://haijunit.top\\",\\"email\\":\\"zhanghaijun_java@163.com\\"}]}"]]},"headers":[{"level":2,"title":"1.1、什么是Vite","slug":"_1-1、什么是vite","link":"#_1-1、什么是vite","children":[]},{"level":2,"title":"1.2 、Vite的主要特性","slug":"_1-2-、vite的主要特性","link":"#_1-2-、vite的主要特性","children":[]},{"level":2,"title":"1.3、 主流构建工具对比","slug":"_1-3、-主流构建工具对比","link":"#_1-3、-主流构建工具对比","children":[{"level":3,"title":"Browserify","slug":"browserify","link":"#browserify","children":[]},{"level":3,"title":"Gulp","slug":"gulp","link":"#gulp","children":[]},{"level":3,"title":"Parcel","slug":"parcel","link":"#parcel","children":[]},{"level":3,"title":"Webpack","slug":"webpack","link":"#webpack","children":[]},{"level":3,"title":"Rollup","slug":"rollup","link":"#rollup","children":[]},{"level":3,"title":"Snowpack","slug":"snowpack","link":"#snowpack","children":[]},{"level":3,"title":"Vite","slug":"vite","link":"#vite","children":[]}]},{"level":2,"title":"1.4、 为什么要使用Vite","slug":"_1-4、-为什么要使用vite","link":"#_1-4、-为什么要使用vite","children":[]},{"level":2,"title":"1.5、 Vite 开发环境 VS 生产环境","slug":"_1-5、-vite-开发环境-vs-生产环境","link":"#_1-5、-vite-开发环境-vs-生产环境","children":[]}],"git":{"createdTime":1684826034000,"updatedTime":1684826034000,"contributors":[{"name":"zhanghaijun","email":"zhanghaijun@bjtxra.com","commits":1}]},"readingTime":{"minutes":6.59,"words":1977},"filePathRelative":"30.编程技巧/15.VUE应用/60.Vite介绍.md","localizedDate":"2023年5月16日","excerpt":"<h2> 1.1、什么是Vite</h2>\\n<blockquote>\\n<p>Vite是一种新型的前端构建工具，它能显著改善前端开发体验。</p>\\n</blockquote>\\n<p>Vite由两个主要部分组成：</p>\\n<ol>\\n<li><code>dev server</code>：利用浏览器的ESM能力来提供源文件，具有丰富的内置功能并具有高效的HMR</li>\\n<li>生产构建：生产环境利用Rollup来构建代码，提供指令用来优化构建过程</li>\\n</ol>\\n<p>Vite作为一个基于浏览器原生ESM的构建工具，它省略了开发环境的打包过程，利用浏览器去解析imports，在服务端按需编译返回。同时，在开发环境拥有速度快到惊人的模块热更新，且热更新的速度不会随着模块增多而变慢。因此，使用Vite进行开发，至少会比Webpack快10倍左右。</p>","autoDesc":true}');export{e as data};
